// import { Route, Routes } from "react-router-dom";
import MainNav from "./Components/layout/MainNav";
import { Box } from "@mui/system";
import Homepage from "./Pages/Homepage";

function App() {
  return (
    <Box  sx={{
      display: 'flex',
      flexDirection: 'column'
    }}>
      <MainNav />
      <Homepage />
    </Box>
  );
}

export default App;
